import React from 'react';
import logo from './logo.svg';
import './App.css';
import './App.sass';
import SearchInput from './components/search-input'

function App() {
  return (
    <div className="App">
      <div class="field">
        <div class="control">
          <input class="input is-primary" type="text" placeholder="Search" />

        </div>
        <button class="button">Search</button>
      </div>
    </div>
  );
}

export default App;
